import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import { LayoutDocs } from 'components/LayoutDocs';

export const meta = {
  "id": "os",
  "title": "os",
  "group": "svelteuidev-utilities",
  "packageGroup": "@svelteuidev/utilities",
  "description": "Retrieves the user's os",
  "example": "https://codesandbox.io/embed/os-h4dvj6?fontsize=14&hidenavigation=1&module=%2FApp.svelte&theme=dark&view=preview"
};

const layoutProps = {
  meta
};
const MDXLayout = ({ children, ...props }) => (
  <LayoutDocs meta={meta} {...props}>{children}</LayoutDocs>
)
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">



    <h2 {...{
      "id": "usage"
    }}>{`Usage`}<a parentName="h2" {...{
        "href": "#usage",
        "title": "Direct link to heading",
        "className": "anchor"
      }}><span parentName="a" {...{
          "className": "icon icon-link"
        }}></span></a></h2>
    <pre><code parentName="pre" {...{
        "className": "language-tsx"
      }}>{`<script>
    import { os as _os } from '@svelteuidev/utilities';

    const os = _os();
</script>

<p>Your os is <b>{os}</b></p>
`}</code></pre>
    <p>{`The os utility function detects a user's os. Possible values are: `}<inlineCode parentName="p">{`undetermined`}</inlineCode>{`, `}<inlineCode parentName="p">{`macos`}</inlineCode>{`, `}<inlineCode parentName="p">{`ios`}</inlineCode>{`, `}<inlineCode parentName="p">{`windows`}</inlineCode>{`, `}<inlineCode parentName="p">{`android`}</inlineCode>{`, `}<inlineCode parentName="p">{`linux`}</inlineCode>{`.
If the os cannot be identified as well as during server side rendering `}<inlineCode parentName="p">{`undetermined`}</inlineCode>{` will be returned.`}</p>
    <h2 {...{
      "id": "typescript"
    }}>{`TypeScript`}<a parentName="h2" {...{
        "href": "#typescript",
        "title": "Direct link to heading",
        "className": "anchor"
      }}><span parentName="a" {...{
          "className": "icon icon-link"
        }}></span></a></h2>
    <p>{`You can import `}<inlineCode parentName="p">{`OS`}</inlineCode>{` union type from `}<inlineCode parentName="p">{`@svelteuidev/utilities`}</inlineCode>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-ts"
      }}>{`import type { OS } from '@svelteuidev/utilities';
// OS type is 'undetermined' | 'macos' | 'ios' | 'windows' | 'android' | 'linux'
`}</code></pre>
    <h2 {...{
      "id": "definition"
    }}>{`Definition`}<a parentName="h2" {...{
        "href": "#definition",
        "title": "Direct link to heading",
        "className": "anchor"
      }}><span parentName="a" {...{
          "className": "icon icon-link"
        }}></span></a></h2>
    <pre><code parentName="pre" {...{
        "className": "language-ts"
      }}>{`function getOS():
  | 'undetermined'
  | 'macos'
  | 'ios'
  | 'windows'
  | 'android'
  | 'linux';
`}</code></pre>
    </MDXLayout>;
}

